    sinphi = sin(phi[i]);
    sin2phi = sinphi*sinphi;

    /* Calculate theoretical normal gravity (gamma) /eq. 4-1/ */
    gamma_ts = (WGS84_G_E)*( 1.0 + (WGS84_K)*sin2phi )/( sqrt(1.0 - (WGS84_E_2)*
      sin2phi) );
