static void AFCS_MODEL1_tand(real_T *x)
{
  int8_T n;
  static real_T b_x;
  static real_T absx;
  if (!!rtIsInf(*x)) {
    *x = (rtNaN);
  } else {
    b_x = AFCS_MODEL1_rt_remd_snf(*x, 360.0);
    absx = fabs(b_x);
    if (absx > 180.0) {
      if (b_x > 0.0) {
        b_x -= 360.0;
      } else {
        b_x += 360.0;
      }

      absx = fabs(b_x);
    }

    if (absx <= 45.0) {
      b_x *= 0.017453292519943295;
      n = 0;
    } else if (absx <= 135.0) {
      if (b_x > 0.0) {
        b_x = (b_x - 90.0) * 0.017453292519943295;
        n = 1;
      } else {
        b_x = (b_x + 90.0) * 0.017453292519943295;
        n = -1;
      }
    } else if (b_x > 0.0) {
      b_x = (b_x - 180.0) * 0.017453292519943295;
      n = 2;
    } else {
      b_x = (b_x + 180.0) * 0.017453292519943295;
      n = -2;
    }

    *x = tan(b_x);
    if ((n == 1) || (n == -1)) {
      b_x = 1.0 / *x;
      *x = -(1.0 / *x);
      if (rtIsInf(*x) && (n == 1)) {
        *x = -(-b_x);
      }
    }
  }
}

