/* Function for MATLAB Function: '<S335>/UAV Trajectory Planning' */
static void AFCS_MODEL1_PGT_CalculateRmin(const real_T xValues[32], const real_T
  yValues[32], int8_T IndataLength, real_T Rmin[32], real_T b_RminNew[255])
{
  static real_T dcwp[255];
  static real_T dwp;
  static real_T ax;
  static real_T ay;
  static real_T bx;
  static real_T by;
  static real_T Cthet;
  int32_T count;
  int8_T i;
  int32_T tmp;

  /* UNTITLED3  */
  /*     */
  /*  */
  memset(&dcwp[0], 0, 255U * sizeof(real_T));
  tmp = IndataLength - 2;
  if (tmp < -128) {
    tmp = -128;
  }

  for (i = 1; i <= (int8_T)tmp; i++) {
    dwp = sqrt((xValues[i] - xValues[i - 1]) * (xValues[i] - xValues[i - 1]) +
               (yValues[i] - yValues[i - 1]) * (yValues[i] - yValues[i - 1]));

    /*      (ax,ay) */
    ax = xValues[i - 1] - xValues[i];
    ay = yValues[i - 1] - yValues[i];

    /*  		(bx,by) */
    bx = xValues[i + 1] - xValues[i];
    by = yValues[i + 1] - yValues[i];
    if (sqrt(ax * ax + ay * ay) * sqrt(bx * bx + by * by) < 1.0E-7) {
      /*  */
      Cthet = 1.0E+7;
    } else {
      Cthet = (ax * bx + ay * by) / (sqrt(ax * ax + ay * ay) * sqrt(bx * bx + by
        * by));

      /* // */
      if (1.0 + Cthet < 1.0E-7) {
        Cthet = 1.0E+7;
      } else {
        Cthet = sqrt((1.0 - Cthet) / (1.0 + Cthet));

        /* // */
      }
    }

    /*  //pi */
    if ((sqrt(ax * ax + ay * ay) * sqrt(bx * bx + by * by) < 1.0E-7) || (fabs
         (atan(Cthet) - 1.5707963267948966) < 1.0E-7) || (fabs(Cthet) < 0.1)) {
      /* 2018/10/22 */
      dcwp[i] = 0.0;

      /* // */
    } else {
      dcwp[i] = Rmin[i] / Cthet;

      /* // */
    }

    /*  */
    count = 0;
    while ((dwp < dcwp[i - 1] + dcwp[i]) && (count < 100)) {
      /* 2018/10/09 */
      Rmin[i] *= 0.95;
      Rmin[i - 1] *= 0.95;
      dcwp[i - 1] *= 0.95;
      dcwp[i] *= 0.95;
      count++;
    }
  }

  memset(&b_RminNew[0], 0, 255U * sizeof(real_T));
  for (i = 1; i <= IndataLength; i++) {
    b_RminNew[i - 1] = Rmin[i - 1];
  }
}

static void rt_mrdivide_U1d1x3_U2d_9vOrDY_k(const real_T u0[3], const real_T u1
  [9], real_T y[3])
{
  static real_T A[9];
  int32_T r1;
  int32_T r2;
  int32_T r3;
  static real_T maxval;
  static real_T a21;
  int32_T rtemp;
  memcpy(&A[0], &u1[0], 9U * sizeof(real_T));
  r1 = 0;
  r2 = 1;
  r3 = 2;
  maxval = fabs(u1[0]);
  a21 = fabs(u1[1]);
  if (a21 > maxval) {
    maxval = a21;
    r1 = 1;
    r2 = 0;
  }

  if (fabs(u1[2]) > maxval) {
    r1 = 2;
    r2 = 1;
    r3 = 0;
  }

  A[r2] = u1[r2] / u1[r1];
  A[r3] /= A[r1];
  A[3 + r2] -= A[3 + r1] * A[r2];
  A[3 + r3] -= A[3 + r1] * A[r3];
  A[6 + r2] -= A[6 + r1] * A[r2];
  A[6 + r3] -= A[6 + r1] * A[r3];
  if (fabs(A[3 + r3]) > fabs(A[3 + r2])) {
    rtemp = r2 + 1;
    r2 = r3;
    r3 = rtemp - 1;
  }

  A[3 + r3] /= A[3 + r2];
  A[6 + r3] -= A[3 + r3] * A[6 + r2];
  y[r1] = u0[0] / A[r1];
  y[r2] = u0[1] - A[3 + r1] * y[r1];
  y[r3] = u0[2] - A[6 + r1] * y[r1];
  y[r2] /= A[3 + r2];
  y[r3] -= A[6 + r2] * y[r2];
  y[r3] /= A[6 + r3];
  y[r2] -= A[3 + r3] * y[r3];
  y[r1] -= y[r3] * A[r3];
  y[r1] -= y[r2] * A[r2];
}

/* Function for MATLAB Function: '<S335>/UAV Trajectory Planning' */
static void AFCS_MODEL1_PGT_changewaypoints(const real_T xValues[32], const
  real_T yValues[32], const real_T hValues[32], int8_T IndataLength, const
  real_T Rmin[255], const real_T vValues[32], real_T vx_qiedian_out[255], real_T
  vy_qiedian_out[255], real_T xn_qiedian_out[255], real_T ye_qiedian_out[255],
  real_T zh_qiedian_out[255])
{
  static real_T K;
  static real_T d_to_front;
  static real_T q1x;
  static real_T q1y;
  static real_T d_to_next;
  static real_T q2x;
  static real_T q2y;
  static real_T Anglerou;
  static real_T Angleroucos;
  int8_T i;
  static real_T a;
  int32_T tmp;
  int32_T tmp_0;

  /*  */
  /* 1.xValuesx */
  /* 2.yValuesy */
  /* 3.zValuesz */
  /* 4.IndataLength */
  /* 5.Rmin */
  /* 6.vValues */
  /*  */
  /* 1.vx:x */
  /* 2.vy:y */
  /* 3.xx:x */
  /* 4.yy:y */
  /* 5.zz:z */
  /* i-1,i,i+1)iii+1 */
  vx_qiedian_out[254] = 0.0;
  vx_qiedian_out[0] = 0.0;
  vy_qiedian_out[254] = 0.0;
  vy_qiedian_out[0] = 0.0;
  xn_qiedian_out[254] = 0.0;
  xn_qiedian_out[0] = 0.0;
  ye_qiedian_out[254] = 0.0;
  ye_qiedian_out[0] = 0.0;
  memset(&zh_qiedian_out[0], 0, 255U * sizeof(real_T));
  memset(&vx_qiedian_out[1], 0, 253U * sizeof(real_T));
  memset(&vy_qiedian_out[1], 0, 253U * sizeof(real_T));
  memset(&xn_qiedian_out[1], 0, 253U * sizeof(real_T));
  memset(&ye_qiedian_out[1], 0, 253U * sizeof(real_T));

  /* % */
  for (i = 1; i <= IndataLength; i++) {
    /*  velocity */
    /* x */
    tmp_0 = i + 1;
    if (tmp_0 > 127) {
      tmp_0 = 127;
    }

    if (fabs(xValues[tmp_0 - 1] - xValues[i - 1]) < 1.0E-7) {
      vx_qiedian_out[i - 1] = 0.0;
      tmp_0 = i + 1;
      if (tmp_0 > 127) {
        tmp_0 = 127;
      }

      if (fabs(yValues[tmp_0 - 1] - yValues[i - 1]) < 1.0E-7) {
        vy_qiedian_out[i - 1] = 0.0;
      } else {
        tmp_0 = i + 1;
        if (tmp_0 > 127) {
          tmp_0 = 127;
        }

        if (yValues[tmp_0 - 1] - yValues[i - 1] > 0.0) {
          vy_qiedian_out[i - 1] = vValues[i - 1];
        } else {
          vy_qiedian_out[i - 1] = -vValues[i - 1];
        }
      }
    } else {
      tmp_0 = i + 1;
      if (tmp_0 > 127) {
        tmp_0 = 127;
      }

      tmp = i + 1;
      if (tmp > 127) {
        tmp = 127;
      }

      K = (yValues[tmp_0 - 1] - yValues[i - 1]) / (xValues[tmp - 1] - xValues[i
        - 1]);
      tmp_0 = i + 1;
      if (tmp_0 > 127) {
        tmp_0 = 127;
      }

      if (xValues[tmp_0 - 1] - xValues[i - 1] >= 0.0) {
        vx_qiedian_out[i - 1] = vValues[i - 1] / sqrt(K * K + 1.0);
      } else {
        vx_qiedian_out[i - 1] = -vValues[i - 1] / sqrt(K * K + 1.0);
      }

      tmp_0 = i + 1;
      if (tmp_0 > 127) {
        tmp_0 = 127;
      }

      if (yValues[tmp_0 - 1] - yValues[i - 1] >= 0.0) {
        vy_qiedian_out[i - 1] = vValues[i - 1] / sqrt(K * K + 1.0) * fabs(K);
      } else {
        vy_qiedian_out[i - 1] = -vValues[i - 1] / sqrt(K * K + 1.0) * fabs(K);
      }
    }

    /* ===================================================== */
    /*                     a*b             x1*x2+y1*y2 */
    /*  COS(theta) =----------------- =  --------------- */
    /*                   |a|*|b|            |a|*|b| */
    /* ===================================================== */
    /*  //waypoints// */
    if ((i == 1) || (i == IndataLength)) {
      xn_qiedian_out[i - 1] = xValues[i - 1];

      /* yht: */
      ye_qiedian_out[i - 1] = yValues[i - 1];
      zh_qiedian_out[i - 1] = hValues[i - 1];
    } else {
      tmp_0 = i - 1;
      if (tmp_0 < -128) {
        tmp_0 = -128;
      }

      a = xValues[i - 1] - xValues[tmp_0 - 1];
      tmp_0 = i - 1;
      if (tmp_0 < -128) {
        tmp_0 = -128;
      }

      d_to_front = yValues[i - 1] - yValues[tmp_0 - 1];
      d_to_front = sqrt(a * a + d_to_front * d_to_front);
      if (d_to_front < 1.0E-7) {
        /*  */
        q1x = 0.0;
        q1y = 0.0;
      } else {
        tmp_0 = i - 1;
        if (tmp_0 < -128) {
          tmp_0 = -128;
        }

        q1x = (xValues[tmp_0 - 1] - xValues[i - 1]) / d_to_front;

        /* COSx, */
        tmp_0 = i - 1;
        if (tmp_0 < -128) {
          tmp_0 = -128;
        }

        q1y = (yValues[tmp_0 - 1] - yValues[i - 1]) / d_to_front;

        /* SIN */
      }

      tmp_0 = i + 1;
      if (tmp_0 > 127) {
        tmp_0 = 127;
      }

      d_to_next = xValues[tmp_0 - 1] - xValues[i - 1];
      tmp_0 = i + 1;
      if (tmp_0 > 127) {
        tmp_0 = 127;
      }

      q2x = yValues[tmp_0 - 1] - yValues[i - 1];
      d_to_next = sqrt(d_to_next * d_to_next + q2x * q2x);
      if (d_to_next < 1.0E-7) {
        q2x = 0.0;
        q2y = 0.0;
      } else {
        tmp_0 = i + 1;
        if (tmp_0 > 127) {
          tmp_0 = 127;
        }

        q2x = (xValues[tmp_0 - 1] - xValues[i - 1]) / d_to_next;
        tmp_0 = i + 1;
        if (tmp_0 > 127) {
          tmp_0 = 127;
        }

        q2y = (yValues[tmp_0 - 1] - yValues[i - 1]) / d_to_next;
      }

      if ((fabs(q1x) + fabs(q1y) < 1.0E-7) || (fabs(q2x) + fabs(q2y) < 1.0E-7))
      {
        /* 0 */
        Anglerou = 0.0;
      } else {
        Angleroucos = q1x * q2x + q1y * q2y;
        if (Angleroucos > 1.0) {
          Angleroucos = 1.0;
        } else {
          if (Angleroucos < -1.0) {
            Angleroucos = -1.0;
          }
        }

        Anglerou = acos(Angleroucos);
      }

      /*         %% */
      /* 2018/10/09 */
      if ((fabs(Anglerou) < 0.087266462599716474) || (3.1415926535897931 -
           Anglerou < 0.087266462599716474)) {
        /* 5 */
        xn_qiedian_out[i - 1] = xValues[i - 1];
        ye_qiedian_out[i - 1] = yValues[i - 1];
      } else {
        xn_qiedian_out[i - 1] = Rmin[i - 1] / tan(Anglerou / 2.0) * q2x +
          xValues[i - 1];
        ye_qiedian_out[i - 1] = Rmin[i - 1] / tan(Anglerou / 2.0) * q2y +
          yValues[i - 1];
      }

      /*          dd = sqrt((xx(i) - xValues(i))*(xx(i) - xValues(i)) + (yy(i) - yValues(i))*(yy(i) - yValues(i)));     % */
      /*          L = sqrt((xValues(i + 1) - xValues(i))*(xValues(i + 1) - xValues(i)) + (yValues(i + 1) - yValues(i))*(yValues(i + 1) - yValues(i)));   % */
      zh_qiedian_out[i - 1] = hValues[i - 1];

      /*  + dd / L*(zValues(i + 1) - zValues(i));    %,yanhongtao,20210220 */
    }
  }
}

