/* Function for MATLAB Function: '<S335>/UAV Trajectory Planning' */
static void AFCS_MODE_PGT_Guidance3D_Dubins(real_T xs, real_T ys, real_T hs,
  real_T vxs, real_T vys, real_T xe, real_T ye, real_T he, real_T vxe, real_T
  vye, real_T Rmin, real_T *R, real_T *Gama, real_T *xq1, real_T *yq1, real_T
  *hq1, real_T *fis, real_T *Lamda1, real_T *xq2, real_T *yq2, real_T *hq2,
  real_T *fi2, real_T *Lamda2, real_T *x0_dot, real_T *y0_dot, real_T *tx_dot,
  real_T *ty_dot, real_T *fi1sum, real_T *fi2sum)
{
  static real_T fi1;
  static real_T fif;
  static real_T L;
  int32_T count;
  static real_T b_xq1;
  static real_T b_yq1;
  static real_T b_fis;
  static real_T b_fi1;
  static real_T b_Lamda1;
  static real_T b_xq2;
  static real_T b_yq2;
  static real_T b_fif;
  static real_T b_fi2;
  static real_T b_Lamda2;
  static real_T b_L;
  static real_T b_x0_dot;
  static real_T b_y0_dot;
  static real_T b_tx_dot;
  static real_T b_ty_dot;
  static real_T c_xq1;
  static real_T c_yq1;
  static real_T c_fis;
  static real_T c_fi1;
  static real_T c_Lamda1;
  static real_T c_xq2;
  static real_T c_yq2;
  static real_T c_fif;
  static real_T c_fi2;
  static real_T c_Lamda2;
  static real_T c_L;
  static real_T c_x0_dot;
  static real_T c_y0_dot;
  static real_T c_tx_dot;
  static real_T c_ty_dot;

  /*  Rmax = sqrt((xs-xe)*(xs-xe) +(ys-ye)*(ys-ye)); */
  /*  if Rmin > Rmax */
  /*      Rmin = Rmax; */
  /*  end */
  AFCS_MODEL1_PGT_Dubins_2Dmin(xs, ys, vxs, vys, xe, ye, vxe, vye, Rmin, &b_xq1,
    &b_yq1, &b_fis, &b_fi1, &b_Lamda1, &b_xq2, &b_yq2, &b_fif, &b_fi2, &b_Lamda2,
    &b_L, &b_x0_dot, &b_y0_dot, &b_tx_dot, &b_ty_dot);
  *xq1 = b_xq1;
  *yq1 = b_yq1;
  *fis = b_fis;
  fi1 = b_fi1;
  *Lamda1 = b_Lamda1;
  *xq2 = b_xq2;
  *yq2 = b_yq2;
  fif = b_fif;
  *fi2 = b_fi2;
  *Lamda2 = b_Lamda2;
  L = b_L;
  *x0_dot = b_x0_dot;
  *y0_dot = b_y0_dot;
  *tx_dot = b_tx_dot;
  *ty_dot = b_ty_dot;

  /* 2018/10/09 */
  count = 0;
  while ((L > 9.999999E+6) && (count < 10)) {
    /* L */
    Rmin *= 0.9;
    AFCS_MODEL1_PGT_Dubins_2Dmin(xs, ys, vxs, vys, xe, ye, vxe, vye, Rmin,
      &c_xq1, &c_yq1, &c_fis, &c_fi1, &c_Lamda1, &c_xq2, &c_yq2, &c_fif, &c_fi2,
      &c_Lamda2, &c_L, &c_x0_dot, &c_y0_dot, &c_tx_dot, &c_ty_dot);
    *xq1 = c_xq1;
    *yq1 = c_yq1;
    *fis = c_fis;
    fi1 = c_fi1;
    *Lamda1 = c_Lamda1;
    *xq2 = c_xq2;
    *yq2 = c_yq2;
    fif = c_fif;
    *fi2 = c_fi2;
    *Lamda2 = c_Lamda2;
    L = c_L;
    *x0_dot = c_x0_dot;
    *y0_dot = c_y0_dot;
    *tx_dot = c_tx_dot;
    *ty_dot = c_ty_dot;
    count++;
  }

  *R = Rmin;
  if (fabs(he - hs) <= L * 1.5574077246549023) {
    *Gama = atan((he - hs) / L);
  } else {
    /*     %%RGama */
    if (he >= hs) {
      *Gama = 1.0;
    } else {
      *Gama = -1.0;
    }
  }

  /* % */
  /* %start */
  if (*Lamda1 == 1.0) {
    *fi1sum = ((6.2831853071795862 + *fis) - fi1) / 6.2831853071795862;
    if (fabs(*fi1sum - AFCS_MODEL1_rt_roundd_snf(*fi1sum)) <=
        2.2204460492503131E-16 * fabs(*fi1sum)) {
      *fi1sum = 0.0;
    } else {
      *fi1sum = (*fi1sum - floor(*fi1sum)) * 6.2831853071795862;
    }
  } else {
    *fi1sum = ((6.2831853071795862 + fi1) - *fis) / 6.2831853071795862;
    if (fabs(*fi1sum - AFCS_MODEL1_rt_roundd_snf(*fi1sum)) <=
        2.2204460492503131E-16 * fabs(*fi1sum)) {
      *fi1sum = 0.0;
    } else {
      *fi1sum = (*fi1sum - floor(*fi1sum)) * 6.2831853071795862;
    }
  }

  if (fabs(fi1 - *fis) < 1.0E-7) {
    *fi1sum = 0.0;
  }

  *hq1 = hs;

  /* %end */
  if (*Lamda2 == 1.0) {
    *fi2sum = ((6.2831853071795862 + *fi2) - fif) / 6.2831853071795862;
    if (fabs(*fi2sum - AFCS_MODEL1_rt_roundd_snf(*fi2sum)) <=
        2.2204460492503131E-16 * fabs(*fi2sum)) {
      *fi2sum = 0.0;
    } else {
      *fi2sum = (*fi2sum - floor(*fi2sum)) * 6.2831853071795862;
    }
  } else {
    *fi2sum = ((6.2831853071795862 + fif) - *fi2) / 6.2831853071795862;
    if (fabs(*fi2sum - AFCS_MODEL1_rt_roundd_snf(*fi2sum)) <=
        2.2204460492503131E-16 * fabs(*fi2sum)) {
      *fi2sum = 0.0;
    } else {
      *fi2sum = (*fi2sum - floor(*fi2sum)) * 6.2831853071795862;
    }
  }

  if (fabs(fif - *fi2) < 1.0E-7) {
    *fi2sum = 0.0;
  }

  *hq2 = he - *fi2sum * Rmin * tan(*Gama);

  /* %%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%% */
}

